PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?dog ?lifespan WHERE {
  ?dog wdt:P31 wd:Q144 .
  ?dog wdt:P569 ?birthDate .
  ?dog wdt:P570 ?deathDate .
  BIND( YEAR( ?deathDate ) - YEAR( ?birthDate ) AS ?lifespan ) VALUES ?oldestDog {
    wd:Q2022604
  }
  FILTER ( ?dog != ?oldestDog )
}
ORDER BY DESC ( ?lifespan )
LIMIT 1

