PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
ASK {
  {
    SELECT ?population2010 ?recentPopulation WHERE {
      {
        SELECT ?population2010 WHERE {
          wd:Q183 p:P1082 ?statement2010 .
          ?statement2010 pq:P585 ?time2010 .
          FILTER ( YEAR( ?time2010 ) = 2010 ) .
          ?statement2010 ps:P1082 ?population2010 .
        }
      }
      {
        SELECT ?recentPopulation WHERE {
          wd:Q183 p:P1082 ?statementRecent .
          ?statementRecent pq:P585 ?timeRecent .
          ?statementRecent ps:P1082 ?recentPopulation .
        }
        ORDER BY DESC ( ?timeRecent )
        LIMIT 1
      }
    }
  }
  BIND( ( ( ?recentPopulation - ?population2010 ) / ?population2010 * 100 ) AS ?percentageChange ) FILTER ( ?percentageChange >= 1 )
}

